Ad | This is my favourite spot around my new neighbourhood and I can’t wait to feed the birds here with my little girl (I hope she likes them as much as I do!).

I know she’s going to be a wonderful little mite and a lot of that will be down to my impact on her. I’m determined to be a patient, empathetic and adventurous teacher.

@TommyHilfiger have just released their new fragrance, #ThisIsImpact (available from @ThePerfumeShop), inspired by those who create a positive impact on the world. It smells real good, too!
